import React from 'react';
import './App.css';
import BTXPriceChart from './BTXPriceChart';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>BTX Price Chart</h1>
      </header>
      <div className="App-body">
        <BTXPriceChart />
      </div>
    </div>
  );
}

export default App;
